INSERT INTO `movie` (`MovieID`, `Title`, `Thumbnail`, `Description`, `Duration`, `Language`, `ReleaseDate`, `Country`, `Genre`, `trailer_url`, `Director`, `Actor`, `RegulationID`, `IDStatus`) VALUES
(1, 'MONKEY MAN BÁO THÙ', 'monkey-man.png', 'Một chàng trẻ vô danh, đã bắt đầu cuộc hành trình trả thù chống lại những kẻ lãnh đạo tham nhũng đã sát hại mẹ anh và đàn áp những người nghèo khổ và yếu thế hơn.', 135, 'Mỹ', '2024-04-04', 'Phụ Đề', 'Hành Động', 'https://youtu.be/TQbLpsc7cGs', 'Dev Patel', 'Dev Patel, Sharlto Copley, Pitobash, Sobhita Dhulipala, Sikandar Kher, Vipin Sharma, Ashwini Kalsekar, Adithi Kalkunte, Makarand Deshpande...', 2, 1),
(2, 'ĐIỀM BÁO CỦA QUỶ', 'diem-bao-cua-quy.png', 'Khi một cô gái người Mỹ được đưa đến Rome để bắt đầu phụng sự Giáo Hội, cô đã phát hiện ra thế lực hắc ám khiến cô hoài nghi về đức tin của chính mình, đồng thời hé lộ một âm mưu kinh hoàng nhằm tái sinh linh hồn ác quỷ đầu thai đến nhân thế.', 135, 'Mỹ', '2024-04-04', 'Phụ Đề', 'Kinh Dị', 'https://youtu.be/s3kWzhwsbpU', 'Arkasha Stevenson\r\n', ' Nell Tiger Free, Tawfeek Barhom, Sonia Braga, Ralph Ineson, and Bill Nighy', 2, 1),
(3, 'TRÒ CHƠI CHẾT CHÓC', 'tro-choi-chet-choc-poster.png', 'Tong và những người bạn chơi trốn tìm tại một ngôi nhà hoang. Bất ngờ, vụ nổ xảy ra khiến Noo Aon - người bạn được Tong đưa đi trốn ở nơi bí mật mắc kẹt. 13 năm sau, một em bé giống hệt Noo Aon xuất hiện và một loạt cái chết bí ẩn diễn ra trong hội bạn chơi trốn tìm năm đó', 105, 'Mỹ', '2024-04-11', 'Phụ Đề', 'Kinh Dị', '', 'Nirun Toomprecha\r\n', 'Longshi Lee, Suttiruk Srithongkul, Thanawee Phongphasawat, Santiphap Thongraya, Natthawut Songklin, Nada Chareontong', 1, 1),
(4, 'B4S - TRƯỚC GIỜ \"YÊU\"', 'b4s-coming-soon.png', 'B4S - Trước Giờ \"Yêu\" sẽ bắt đầu bằng một đêm \"nhớ đời\" của hai nhóm bạn thân tại quán bar. Và sau đó, khán giả sẽ được theo dõi câu chuyện tình yêu của từng người trong \"đêm định mệnh\" ấy.', 99, 'Việt Nam', '2024-04-12', 'VN', 'Tình Cảm, Phim Hài, Tâm Lý', 'https://youtu.be/0MWBlIXAtGc', 'Tùng Leo, Michael Thái, Huỳnh Anh Duy\r\n\r\n\r\n', 'Jun Vũ, Khánh Vân, Khazsak, Tôn Kinh Lâm, Tùng, Việt Hưng, Vinh Râu', 2, 1),
(5, 'CÁI GIÁ CỦA HẠNH PHÚC', 'cai-gia-cua-hanh-phuc-poster.png', 'Bà Dương và ông Thoại luôn cố gắng để xây dựng một hình ảnh gia đình tài giỏi và danh giá trong mắt mọi người. Tuy nhiên dưới lớp vỏ bọc hào nhoáng ấy là những biến cố và lục đục gia đình đầy sóng gió. Nhìn kĩ hơn một chút bức tranh gia đình hạnh phúc ấy, rất nhiều “khuyết điểm” sẽ lộ ra gây bất ngờ.', 130, 'Việt Nam', '2024-04-18', 'VN', 'Tình Cảm, Tâm Lý', 'https://youtu.be/7Bysp9dT_Wg', 'Nguyễn Ngọc Lâm\r\n\r\n', 'Thái Hòa, Xuân Lan, Lâm Thanh Nhã, Uyển Ân', 2, 1),
(6, 'LUCA 2D LT: MÙA HÈ CỦA LUCA', 'mua-he-cua-luca.png', '\"Mùa Hè Của Luca\" kể về chuyến hành trình của cậu bé Luca tại hòn đảo Portorosso thuộc vùng biển Địa Trung Hải ở Ý tuyệt đẹp. Ở đây cậu đã làm quen và kết thân với những người bạn nhỏ mới và tận hưởng mùa hè đầy nắng, kem Gelato và cả món mì Ý trứ danh. Tuy nhiên có một điều không ổn lắm, Luca là một THỦY QUÁI và những người dân trên hòn đảo này lại không thích điều này chút nào.', 105, 'Khác', '2024-04-19', 'Lồng Tiếng', 'Hoạt hình', 'https://youtu.be/2KT27tlBatE', 'Enrico Casarosa\r\n', ' Jacob Tremblay, Jack Dylan Grazer, Emma Berman, Saverio Raimondo, Maya Rudolph, Marco Barricelli, Jim Gaffigan, Sandy Martin\r\n', 4, 1),
(7, 'ANH HÙNG BÀN PHÍM', 'anh-hung-ban-phim-poster.png', 'Im Sang-jin - một phóng viên mảng xã hội đã bị đình chỉ công tác sau bài phóng sự điều tra sai lệch về những lùm xùm của tập đoàn Manjun. Tưởng rằng phải chịu nỗi oan ức suốt đời, Im Sang-jin bất ngờ nhận được thông tin ẩn danh khẳng định anh không sai, mà mọi thứ đã bị thao túng bởi một “đội quân” trực tuyến: Chỉ cần có tiền, sự thật nào cũng hoá thành dối lừa, còn tin tức giả lại hoá thành sự thật.', 105, 'Khác', '2024-04-19', 'Phụ Đề', 'Hành Động', 'https://youtu.be/tlpRjjHgZLo', 'Ahn Guk Jin\r\n', 'Son Sukku, Kim Sung-Cheol, Kim Dong-Hwi, Hong Kyung\r\n', 1, 1),
(8, 'GODZILLA X KONG: ĐẾ CHẾ MỚI', 'godzilla-x-kong.png', 'Kong và Godzilla - hai sinh vật vĩ đại huyền thoại, hai kẻ thủ truyền kiếp sẽ cùng bắt tay thực thi một sứ mệnh chung mang tính sống còn để bảo vệ nhân loại, và trận chiến gắn kết chúng với loài người mãi mãi sẽ bắt đầu.', 125, 'VN', '2024-03-27', 'Khác', 'Khoa Học Viễn Tưởng', 'https://youtu.be/Pxge99xjWDQ', 'Adam Wingard\r\n\r\n', 'Rebecca Hall, Dan Stevens, Rachel House', 5, 1),
(9, 'BIỆT ĐỘI SĂN MA (T13): KỶ NGUYÊN BĂNG GIÁ', 'biet-doi-san-ma-SCDB.png', 'Sau các sự kiện của Ghostbusters: Afterlife, gia đình Spengler đang tìm kiếm cuộc sống mới ở Thành phố New York. Nhóm săn ma bao gồm Ray, Winston và Podcast sử dụng công nghệ mới để chống lại các mối đe dọa chết người cổ xưa đang ẩn náu trong các vật dụng hàng ngày. Thế nhưng, họ sẽ phải đối đầu với một thế lực đen tối hùng mạnh mới.', 115, 'VN', '2024-04-12', 'Mỹ', 'Phim Hài, Phiêu Lưu, Khoa Học Viễn Tưởng', 'https://youtu.be/KMJCBpvtzq8', 'Gil Kenan\r\n\r\n', 'William Atherton, Emily Alyn Lind, James Acaster, Annie Potts, Ernie Hudson', 3, 1),
(10, 'TU VIỆN MÁU', 'tu-vien-mau.png', 'Với đức tin sâu sắc, Cecilia đến với một tu viện cổ kính, nằm giữa một vùng quê đẹp nên thơ tại nước Ý trong sự chào đón của mọi người. Thế nhưng, những sự kiện kỳ lạ liên tiếp xảy ra, một bước ngoặt đưa Cecilia đến một vị trí cô không thể ngờ tới. Cùng với đó, những bí mật kinh hoàng đằng sau vẻ bình yên của tu viện này dần lộ diện.\r\n\r\n', 85, 'Phụ Đề', '2024-04-19', 'Mỹ', ' Kinh Dị', 'https://youtu.be/Iocr2svmDKU', 'Michael Mohan\r\n\r\n', 'Sydney Sweeney, Álvaro Morte, Simona Tabasco', 2, 1),
(11, 'THẦN BÀI TRỞ LẠI TẤT TAY', 'all-in.png', 'Mang danh thần bài trăm trận trăm thắng, Trình Gia Lãng phát hoảng khi siêu năng lực mắt thần đột nhiên mất vào tay một kẻ gà mờ - Hoàng Tiểu Thất. Từ đây, cả hai phải miễn cưỡng hợp lực hòng chiến thắng vua bài - Vi Nhất Phú và làm lộ ra bí mật động trời...', 100, 'Phụ Đề', '2024-04-19', '', 'Phim Hài', 'https://youtu.be/UkL6dE89Fxo', 'Matt Lai\r\n', 'Khương Hạo Văn, Lâm Đức Tài, Hoàng Minh Chí,…\r\n', 1, 1),
(12, 'NGÀY TÀN CỦA ĐẾ QUỐC', 'ngay-tan-cua-de-quoc_1.png', 'Trong một tương lai gần, một nhóm các phóng viên chiến trường quả cảm phải đấu tranh với thời gian và bom đạn nguy hiểm để đến kịp Nhà Trắng giữa bối cảnh nội chiến Hoa Kỳ đang tiến đến cao trào.', 125, ' Phụ Đề', '2024-04-12', 'Khác', 'Hành Động', 'https://youtu.be/qmG2iWu4fM8', 'Alex Garland\r\n', 'Kristen Dunst, Wagner Moura, Cailee Spaeny,...\r\n', 2, 1),
(13, 'THANH XUÂN 18X2: LỮ TRÌNH HƯỚNG VỀ EM (T13)', 'thanh-xuan-18x2-poster-2.png', 'Ký ức tình đầu ùa về khi Jimmy nhận được tấm bưu thiếp từ Ami. Cậu quyết định một mình bước lên chuyến tàu đến Nhật Bản gặp lại người con gái cậu đã bỏ lỡ 18 năm trước. Mối tình day dứt thời thanh xuân, liệu sẽ có một kết cục nào tốt đẹp khi đoàn tụ?', 135, 'Phụ Đề', '2024-04-03', 'Khác', 'Tình Cảm', 'https://youtu.be/kpzTxHLwTJ4', 'Michihito Fujii\r\n\r\n', 'Hứa Quang Hán, Kiyohara Kaya, Trương Chấn', 3, 2),
(14, 'NHỮNG KẺ THÁCH ĐẤU', 'nhung-ke-thach-dau.png', 'Đến từ nhà làm phim với tầm nhìn đáng nể Luca Guadagnino, “Những Kẻ Thách Đấu” có sự góp mặt của Zendaya trong vai Tashi Duncan, một cựu thần đồng quần vợt, một người không từ bất cứ thủ đoạn nào để dành chiến thắng (dù là trong hay ngoài sân đấu). Cô kết hôn với một nhà vô địch đang đối mặt với chuỗi trận thua liên tiếp. Kế hoạch tìm lại hào quang cho chồng của Tashi đối mặt với bước ngoặt lớn khi đối thủ mà chồng cô phải đối mặt là Patrick. ', 99, 'VN', '2024-05-10', 'Khác', 'Hành Động', 'https://cinestar.com.vn/_next/image/?url=https%3A%2F%2Fapi-website.cinestar.com.vn%2Fmedia%2Fwysiwyg%2FPosters%2F04-2024%2Ftro-choi-chet-choc-poster.jpg&w=1920&q=75', 'Luca Guadagnino\r\n\r\n', 'Jake Jensen, A.J. Lister, Josh O\'Connor, Mike Faist, Zendaya', 1, 2),
(15, 'ABIGAIL', 'abigail.png', 'Một nhóm tội phạm bắt cóc một diễn viên ba lê nhí - con gái của một ông trùm quyền lực trong thế giới ngầm. Chúng trốn đến một biệt thự biệt lập, nhưng không hề hay biết mình đang bị giam cầm cùng một \"cô bé\" hoàn toàn không bình thường.', NULL, 'Phụ Đề', '2024-04-19', 'Mỹ', ' Kinh Dị', 'https://youtu.be/c7JiYfYR9I4', 'Matt Bettinelli-Olpin, Tyler Gillett\r\n', ' Giancarlo Esposito, Alisha Weir, Kathryn Newton, Dan Stevens,...\r\n', 1, 2),
(16, 'Hành Tinh Khỉ', 'hanh-tinh-khi.png', 'Kingdom Of The Planet Of The Apes lấy bối cảnh nhiều năm sau triều đại của Proximus Ceasar trong War for the Planet of The Apes (2017). Khỉ trở thành giống loài thống trị thế giới, còn con người phải khép mình trong bóng tối. Triều đại độc tài mới được thiết lập. Noa – một chú khỉ trẻ đặt ra những câu hỏi về quá khứ của hành tinh khỉ và dấn thân vào hành trình chống lại đế chế mới.', 99, 'Phụ Đề', '2024-05-10', 'Khác\r\n', 'Khoa Học Viễn Tưởng', 'https://youtu.be/UXKijTQFJH4', 'Wes Ball\r\n', 'Kevin Durand, Freya Allan, Owen Teague\r\n', 3, 2);
